  const handleClick = () => {
    setButtonClick(true);
    handleToggleModal();
  };

  return (
    <>
      <h2>ContextQ1Detail</h2>
      <button
        onClick={() => {
          handleToggleModal();
        }}
      >
        {isModalOpen ? "숨기기" : "보이기"}
      </button>
      <ContextQ1Detail2 />
    </>
  );
};
export default ContextQ1Detail;
